Our raffle will be ending Monday August 16th!  Join us in the effort to help
@lexxachexx raise funds to get her some very much needed wheels to help her get around. Depending on a ride share program and wasting several hours in your day is frustrating especially when they cancel on you or change plans.  Most of the time they’re not dependable. I can’t speak on how it feels being in a wheelchair permanently or having to be on everyone else’s time just to even get to work, doctors appointments, and any important life moment. It sucks and leaves you feeling helpless at times. So a few of my friends and i have gotten together and are donating items to be raffled off at $1 a ticket. We will have 4 winners! Please donate to PayPal : avilanek@yahoo.com every dollar will get you an entry to win !
